import React from 'react';
import "./styles/Footer.css";
import "./styles/Navigationbar.css";

const Footer = (props) => (

    <div className="footer toolbarNavigationItems">
        <ul>
            <li>Impressum</li>
            <li>Kontakt</li>
            <li>Kategorien</li>
        </ul>
    </div>
);

export default Footer;
